// src/components/UserForm.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';
import useForm from '../hooks/useForm';

const validate = (values) => {
  const errors = {};
  if (!values.name) errors.name = 'Name is required';
  if (!values.email) errors.email = 'Email is required';
  else if (!/\S+@\S+\.\S+/.test(values.email)) errors.email = 'Email is invalid';
  if (!values.role) errors.role = 'Role is required';
  return errors;
};

const UserForm = ({ initialValues = {}, onSubmit }) => {
  const navigate = useNavigate();
  const { values, errors, touched, handleChange, handleSubmit, isSubmitting } = useForm(
    {
      name: initialValues.name || '',
      email: initialValues.email || '',
      role: initialValues.role || '',
      avatar: initialValues.avatar || '',
      status: initialValues.status || false,
    },
    validate
  );

  return (
    <form onSubmit={(e) => handleSubmit(e, onSubmit)} className="UserForm-form">
      <div className="UserForm-field">
        <label>Name</label>
        <input
          type="text"
          name="name"
          value={values.name}
          onChange={handleChange}
        />
        {touched.name && errors.name && (
          <span className="UserForm-error">{errors.name}</span>
        )}
      </div>
      <div className="UserForm-field">
        <label>Email</label>
        <input
          type="email"
          name="email"
          value={values.email}
          onChange={handleChange}
        />
        {touched.email && errors.email && (
          <span className="UserForm-error">{errors.email}</span>
        )}
      </div>
      <div className="UserForm-field">
        <label>Role</label>
        <select name="role" value={values.role} onChange={handleChange}>
          <option value="">Select Role</option>
          <option value="Admin">Admin</option>
          <option value="User">User</option>
          <option value="Guest">Guest</option>
        </select>
        {touched.role && errors.role && (
          <span className="UserForm-error">{errors.role}</span>
        )}
      </div>
      <div className="UserForm-field">
        <label>Avatar URL</label>
        <input
          type="text"
          name="avatar"
          value={values.avatar}
          onChange={handleChange}
          placeholder="Optional"
        />
        {values.avatar && (
          <img
            src={values.avatar}
            alt="Avatar Preview"
            className="UserForm-avatar-preview"
            width="50"
            height="50"
          />
        )}
      </div>
      <div className="UserForm-field">
        <label>
          <input
            type="checkbox"
            name="status"
            checked={values.status}
            onChange={(e) =>
              handleChange({
                target: { name: 'status', value: e.target.checked },
              })
            }
          />
          Active
        </label>
      </div>
      <div className="UserForm-actions">
        <button
          type="submit"
          disabled={isSubmitting}
          className="UserForm-submit"
        >
          {isSubmitting ? 'Submitting...' : 'Submit'}
        </button>
        <button
          type="button"
          onClick={() => navigate('/')}
          className="UserForm-cancel"
        >
          Cancel
        </button>
      </div>
    </form>
  );
};

export default UserForm;
